 of traditional apps to enhance the apps with immersive content. For example, VR view makes it easy for a travel app to provide viewers with an underwater scuba diving tour as they plan a vacation or for a home builder to take prospective buyers on a virtual walkthrough before the home is built.</blockquote><pre>pod&nbsp;\'GVRSDK\'&nbsp;//cocoapods&nbsp;iOScocoapods.......</pre><p><a href=\"https://developers.google.com/vr/ios/reference/\" target=\"_blank\"></a></p><p>Google VRView GVRCardboardViewGVRWidgetViewGVRPanoramaViewGVRVideoView</p><blockquote>GVRCardboardView&nbsp;&nbsp;Defines a view responsible for rendering graphics in VR modeGVRWidgetView &nbsp;&nbsp;Defines a base class for all widget views, that encapsulates common functionalityGVRPanoramaView&nbsp;&nbsp; &nbsp;Defines a view that can load and display 360-degree panoramic photosGGVRVideoView &nbsp;&nbsp;Defines a player view that renders a 360 video using OpenGL</blockquote><p>GVRCardboardView 3DOpenGLSceneKitGVRPanoramaViewGVRVideoView</p><p>ViewGVRPanoramaView </p><blockquote>GVRPanoramaView Inherits() GVRWidgetView Inherits() UIView</blockquote><p>step1storyboardUIViewController</p><p><img src=\"http://cc.cocimg.com/api/uploads/20161101/1477965029424622.png\" alt=\"2751003-65554e23c12a7445.png\"></p><pre>@IBOutlet&nbsp;weak&nbsp;var&nbsp;panoView:&nbsp;GVRPanoramaView!\npanoView.enableFullscreenButton&nbsp;=&nbsp;truepanoView.enableCardboardButton&nbsp;=&nbsp;truepanoView.enableTouchTracking&nbsp;=&nbsp;truepanoView.load(UIImage(named:&nbsp;\"\"),&nbsp;of:&nbsp;.stereoOverUnder)</pre><table><thead><tr><th>Property</th><th></th></tr></thead><tbody><tr><td><gvrwidgetviewdelegate>delegate</gvrwidgetviewdelegate></td><td>The delegate that is called when the widget view is loaded.</td></tr><tr><td>enableFullscreenButton</td><td>fullScreen </td></tr><tr><td>enableCardboardButton</td><td> cardboard </td></tr><tr><td>enableTouchTracking</td><td></td></tr></tbody></table><p><img src=\"http://cc.cocimg.com/